    }

    
}

/**
 * @suppress
 */
public object FfiConverterTypeMeshError : FfiConverterRustBuffer<MeshException> {
    override fun read(buf: ByteBuffer): MeshException {
        

        return when(buf.getInt()) {
            1 -> MeshException.InvalidKey()
            2 -> MeshException.InvalidSignature()
            3 -> MeshException.InsufficientBalance()
            4 -> MeshException.InvalidIou()
            5 -> MeshException.StorageException()
            6 -> MeshException.SyncException()
            7 -> MeshException.TransportException()
            8 -> MeshException.SerializationException()
            9 -> MeshException.RecipientMismatch()
            10 -> MeshException.DuplicateTransaction()
            else -> throw RuntimeException("invalid error enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: MeshException): ULong {
        return when(value) {
            is MeshException.InvalidKey -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is MeshException.InvalidSignature -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is MeshException.InsufficientBalance -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is MeshException.InvalidIou -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is MeshException.StorageException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is MeshException.SyncException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is MeshException.TransportException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is MeshException.SerializationException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is MeshException.RecipientMismatch -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is MeshException.DuplicateTransaction -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
        }
    }

    override fun write(value: MeshException, buf: ByteBuffer) {
        when(value) {
            is MeshException.InvalidKey -> {
                buf.putInt(1)
                Unit
            }
            is MeshException.InvalidSignature -> {
                buf.putInt(2)
                Unit
            }
            is MeshException.InsufficientBalance -> {
                buf.putInt(3)
                Unit
            }
            is MeshException.InvalidIou -> {
                buf.putInt(4)
                Unit
            }
            is MeshException.StorageException -> {
                buf.putInt(5)
                Unit
            }
            is MeshException.SyncException -> {
                buf.putInt(6)
                Unit
            }
            is MeshException.TransportException -> {
                buf.putInt(7)
                Unit
            }
            is MeshException.SerializationException -> {
                buf.putInt(8)
                Unit
            }
            is MeshException.RecipientMismatch -> {
                buf.putInt(9)
                Unit
            }
            is MeshException.DuplicateTransaction -> {
                buf.putInt(10)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }

}




/**
 * @suppress
 */
public object FfiConverterOptionalString: FfiConverterRustBuffer<kotlin.String?> {
    override fun read(buf: ByteBuffer): kotlin.String? {
        if (buf.get().toInt() == 0) {
            return null
        }
        return FfiConverterString.read(buf)
    }

    override fun allocationSize(value: kotlin.String?): ULong {
        if (value == null) {
            return 1UL
        } else {
            return 1UL + FfiConverterString.allocationSize(value)
        }
    }

    override fun write(value: kotlin.String?, buf: ByteBuffer) {
        if (value == null) {
            buf.put(0)
        } else {
            buf.put(1)
            FfiConverterString.write(value, buf)
        }
    }
}




/**
 * @suppress
 */
public object FfiConverterSequenceTypeSignedIOU: FfiConverterRustBuffer<List<SignedIou>> {
    override fun read(buf: ByteBuffer): List<SignedIou> {
        val len = buf.getInt()
        return List<SignedIou>(len) {
            FfiConverterTypeSignedIOU.read(buf)
        }
    }

    override fun allocationSize(value: List<SignedIou>): ULong {
        val sizeForLength = 4UL
        val sizeForItems = value.map { FfiConverterTypeSignedIOU.allocationSize(it) }.sum()
        return sizeForLength + sizeForItems
    }

    override fun write(value: List<SignedIou>, buf: ByteBuffer) {
        buf.putInt(value.size)
        value.iterator().forEach {
            FfiConverterTypeSignedIOU.write(it, buf)
        }
    }
}




